const cropUrl = "http://localhost:3020/cropfaceonly"; //crop-face-only
  
async function sendBase64(bs64) {
  var response;
  try {
    response1 = await axios.post(cropUrl, { imgBase64: bs64 });
    if (
      response1.data.status === false &&
      response1.data.message === "Please use another image"
    ) {
      const respData = {
        status: false,
        mes: "Please use another image",
      };
      return respData;
    } else {
      const respData = {
        status: true,
        mes: response1.data.message,
      };
      return respData;
    }
  } catch (error) {
    console.error(error);
    const respData = {
      status: false,
      mes: error,
    };
    return respData;
  }
}

